import { useEffect, useState } from "react"
import Api, { endpoints } from "../configs/Api"

export default function Home(){
    const [work , setWork]= useState()

    useEffect(() =>{
        let loadWork = async() =>  {
            let res = await Api.get(endpoints['work'])
            setWork = res.data
        }
    },[])
    return(
       <h1></h1>
    )
    
}
